<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no, viewport-fit=cover">
<meta name="mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-status-bar-style" content="black-fullscreen">
<meta name="theme-color" content="#000">
<title>Street Fighter II Turbo â€” SNES</title>
<style>
*{margin:0;padding:0;box-sizing:border-box;-webkit-tap-highlight-color:transparent;}
:root{
  --red:#ff0000;--yellow:#ffdd00;--blue:#0044ff;--dk:#000008;
  --btn:#08000a;--bb:#220033;--ba:#880000;--tx:#ffaaaa;
}
html,body{width:100%;height:100%;background:#000;overflow:hidden;font-family:'Courier New',monospace;touch-action:none;}

/* SPLASH */
#splash{
  position:fixed;inset:0;z-index:999;
  background:linear-gradient(180deg,#000005 0%,#0a0000 50%,#000 100%);
  display:flex;flex-direction:column;align-items:center;justify-content:center;gap:10px;
  overflow:hidden;
}

/* VS screen flash */
#splash::before{
  content:'';position:absolute;inset:0;
  background:radial-gradient(ellipse at 50% 50%, #ff000008 0%, transparent 70%);
  animation:vsflash 2s ease-in-out infinite;pointer-events:none;
}
@keyframes vsflash{0%,100%{opacity:0.3}50%{opacity:1}}

/* Ground line */
#splash::after{
  content:'';position:absolute;bottom:18%;left:0;right:0;height:3px;
  background:linear-gradient(90deg,transparent,#ff000066,#ffdd0066,#ff000066,transparent);
  animation:groundpulse 2s ease-in-out infinite;
}
@keyframes groundpulse{0%,100%{opacity:0.4}50%{opacity:1}}

.fighters{
  font-size:42px;display:flex;gap:30px;align-items:center;
  animation:fightbounce 0.8s ease-in-out infinite alternate;
}
@keyframes fightbounce{from{transform:translateY(0)}to{transform:translateY(-8px)}}

.vs-text{
  font-size:clamp(20px,7vw,36px);color:#ffdd00;
  text-shadow:0 0 15px #ffaa00,2px 2px 0 #884400;
  font-weight:bold;letter-spacing:2px;
  animation:vspulse 0.5s ease-in-out infinite alternate;
}
@keyframes vspulse{from{transform:scale(1)}to{transform:scale(1.15)}}

#splash h1{
  font-size:clamp(13px,4.5vw,22px);
  color:#fff;letter-spacing:4px;
  text-shadow:2px 2px 0 #000;
  text-transform:uppercase;
  background:var(--red);padding:4px 16px;
  clip-path:polygon(8px 0%, 100% 0%, calc(100% - 8px) 100%, 0% 100%);
}
#splash h2{
  font-size:clamp(30px,11vw,62px);
  color:var(--yellow);letter-spacing:4px;
  text-shadow:0 0 30px #ffaa00,0 0 60px #ff6600,4px 4px 0 #884400;
  text-transform:uppercase;text-align:center;line-height:1;
  animation:sf2glow 1.5s ease-in-out infinite;
}
@keyframes sf2glow{
  0%,100%{text-shadow:0 0 30px #ffaa00,0 0 60px #ff6600,4px 4px 0 #884400}
  50%{text-shadow:0 0 50px #ffdd00,0 0 100px #ffaa00,4px 4px 0 #884400}
}
#splash h3{
  font-size:clamp(16px,6vw,32px);
  color:var(--red);letter-spacing:6px;
  text-shadow:0 0 20px #ff0000,3px 3px 0 #660000;
  text-transform:uppercase;
}

.hadoken{color:#aaddff;font-size:10px;letter-spacing:2px;text-shadow:0 0 6px #88bbff;}

#splash .platform{
  color:var(--tx);font-size:clamp(7px,2vw,10px);
  letter-spacing:3px;border:1px solid #330000;
  padding:5px 16px;background:rgba(0,0,0,0.6);
}
#play-btn{
  padding:14px 48px;background:transparent;
  border:2px solid var(--yellow);color:var(--yellow);
  font-family:'Courier New',monospace;font-size:clamp(13px,3.5vw,16px);
  letter-spacing:4px;cursor:pointer;text-transform:uppercase;
  animation:glw 1.4s ease-in-out infinite;margin-top:4px;
  clip-path:polygon(10px 0%,100% 0%,calc(100% - 10px) 100%,0% 100%);
}
@keyframes glw{0%,100%{box-shadow:0 0 12px #ffdd0099}50%{box-shadow:0 0 30px #ffdd00ff,inset 0 0 10px #ffaa0015}}
#play-btn:active{background:var(--yellow);color:#000;animation:none;}

/* APP */
#app{display:none;flex-direction:column;width:100%;height:100%;}

#topbar{
  height:36px;min-height:36px;
  background:linear-gradient(90deg,#000,#0d0000,#000);
  border-bottom:2px solid #330000;
  display:flex;align-items:center;justify-content:space-between;padding:0 12px;flex-shrink:0;
}
#topbar .logo{color:var(--yellow);font-size:10px;letter-spacing:3px;text-shadow:0 0 8px var(--yellow);}
.tbtn{background:none;border:1px solid #330000;color:var(--tx);font-size:15px;padding:3px 9px;cursor:pointer;border-radius:3px;}
.tbtn:active{background:var(--red);color:#fff;}

#screen{
  flex:1;background:#000;display:flex;align-items:center;justify-content:center;
  position:relative;overflow:hidden;min-height:0;
}
#screen::after{
  content:'';position:absolute;inset:0;pointer-events:none;z-index:5;
  background:repeating-linear-gradient(0deg,transparent,transparent 2px,rgba(0,0,0,.08) 2px,rgba(0,0,0,.08) 4px);
}
#game{width:100%;height:100%;display:flex;align-items:center;justify-content:center;}
#game canvas{image-rendering:pixelated;image-rendering:crisp-edges;display:block;}

#loader{
  position:absolute;inset:0;z-index:10;
  background:radial-gradient(ellipse at center,#08000a 0%,#000 100%);
  display:flex;flex-direction:column;align-items:center;justify-content:center;gap:14px;
}
#loader .l-icon{font-size:42px;animation:spin 1s linear infinite;}
@keyframes spin{to{transform:rotate(360deg)}}
#loader h2{color:var(--yellow);font-size:clamp(14px,5vw,26px);letter-spacing:4px;text-shadow:0 0 16px #ffaa00;text-align:center;}
#loader h3{color:var(--red);font-size:clamp(9px,3vw,13px);letter-spacing:3px;}
#lbar-wrap{width:230px;height:8px;border:1px solid #330000;background:#050000;}
#lbar{height:100%;width:0%;background:linear-gradient(90deg,#880000,var(--red),var(--yellow));box-shadow:0 0 8px var(--yellow);transition:width .25s;}
#lmsg{color:#442222;font-size:8px;letter-spacing:2px;}
#lerr{color:#ff4444;font-size:9px;display:none;text-align:center;max-width:280px;line-height:1.8;}
</style>
</head>

function b64ToBytes(b64) {
  const s = atob(b64);
  const u = new Uint8Array(s.length);
  for (let i = 0; i < s.length; i++) u[i] = s.charCodeAt(i);
  return u;
}

function boot() {
  document.getElementById('splash').style.display = 'none';
  document.getElementById('app').style.display = 'flex';
  loadEmulator();
}

function setProgress(pct, msg) {
  document.getElementById('lbar').style.width = pct + '%';
  document.getElementById('lmsg').textContent = msg;
}

function showError(msg) {
  const e = document.getElementById('lerr');
  e.textContent = msg; e.style.display = 'block';
  setProgress(100, 'ERROR');
  document.getElementById('lbar').style.background = '#ff2200';
}

function loadEmulator() {
  setProgress(10, 'DECODIFICANDO ROM...');

  window.EJS_backgroundColor = '#000000';

  window.EJS_VirtualGamepad  = true;

    gamepad:true, mute:true, settings:true, fullscreen:false,
    save:true, load:true, screenshot:false, cheat:false,
    volume:true, quickSave:true, quickLoad:true,
    zoom:false, crt:false, ratio:false, reset:true,
  };
  window.EJS_defaultOptions = {
    'save-state-slot': 1,
    'video-smooth': false,
  };

  window.EJS_onLoadProgress = function(p) {
    setProgress(40 + p * 55, 'CARGANDO CORE SNES... ' + Math.round(p*100) + '%');
  };

  window.EJS_onGameStart = function() {
    setProgress(100, 'Â¡FIGHT!');
    setTimeout(() => { document.getElementById('loader').style.display = 'none'; }, 600);
  };

  const s = document.createElement('script');
  s.src = 'https://cdn.emulatorjs.org/stable/data/loader.js';
  s.onerror = () => {
    const s2 = document.createElement('script');
    s2.src = 'https://cdn.jsdelivr.net/npm/emulatorjs@latest/data/loader.js';
    s2.onerror = () => showError('No se pudo cargar EmulatorJS.\nVerifica tu conexiÃ³n a internet.');
    document.head.appendChild(s2);
  };
  document.head.appendChild(s);

  let fake = 40;
  const iv = setInterval(() => {
    if (document.getElementById('loader').style.display === 'none') { clearInterval(iv); return; }
    fake = Math.min(fake + 1, 94);
    if (fake < 94) setProgress(fake, 'CARGANDO CORE SNES...');
  }, 350);
}

function toggleFS() {
  if (!document.fullscreenElement) {
    document.documentElement.requestFullscreen({navigationUI:'hide'}).catch(()=>{});
    if (screen.orientation?.lock) screen.orientation.lock('landscape').catch(()=>{});
  } else { document.exitFullscreen?.(); }
}

let muted = false;
function toggleMute() {
  muted = !muted;
  document.getElementById('muteBtn').textContent = muted ? 'ðŸ”‡' : 'ðŸ”Š';
  if (window.EJS_emulator?.setVolume) EJS_emulator.setVolume(muted ? 0 : 1);
  document.querySelectorAll('audio,video').forEach(a => a.muted = muted);
}

document.addEventListener('touchmove', e => { if (e.touches.length > 1) e.preventDefault(); }, {passive:false});
document.addEventListener('gesturestart', e => e.preventDefault(), {passive:false});
</script>
</body>
